// Footer.jsx - Enhanced Version
import React from 'react';
import { motion } from 'framer-motion';
import './Footer.css';

const Footer = ({ onNavigate }) => {
  const handleNavigation = (page) => {
    if (typeof onNavigate === 'function') {
      onNavigate(page);
    }
  };

  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-content">
          <motion.div
            className="footer-section"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            viewport={{ once: true, margin: "-50px" }}
          >
            <motion.h3
              whileHover={{ scale: 1.05 }}
              transition={{ duration: 0.3 }}
            >
              üå± Smart Ecodispose
            </motion.h3>
            <motion.p
              initial={{ opacity: 0 }}
              whileInView={{ opacity: 1 }}
              transition={{ delay: 0.2 }}
              viewport={{ once: true }}
            >
              Making sustainable choices easy for everyone. Together, we can reduce contamination and promote recycling.
            </motion.p>
            <div className="social-links">
              {['üìò', 'üê¶', 'üì∑', 'üíº'].map((icon, index) => (
                <motion.a
                  key={index}
                  href="#"
                  whileHover={{ scale: 1.3, rotate: 10, y: -5 }}
                  whileTap={{ scale: 0.9 }}
                  transition={{ type: "spring", stiffness: 400, damping: 10 }}
                >
                  {icon}
                </motion.a>
              ))}
            </div>
          </motion.div>

          <motion.div
            className="footer-section"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.1 }}
            viewport={{ once: true, margin: "-50px" }}
          >
            <h4>Quick Links</h4>
            <ul>
              {[
                { page: 'home', icon: 'üè†', label: 'Home' },
                { page: 'identification', icon: 'üîç', label: 'Identify Waste' },
                { page: 'local-rules', icon: 'üìã', label: 'Local Rules' },
                { page: 'upcycling', icon: '‚ôªÔ∏è', label: 'Upcycling Ideas' }
              ].map((item, index) => (
                <li key={item.page}>
                  <motion.button
                    onClick={() => handleNavigation(item.page)}
                    whileHover={{ x: 8, scale: 1.05 }}
                    whileTap={{ scale: 0.95 }}
                    transition={{ duration: 0.2 }}
                  >
                    {item.icon} {item.label}
                  </motion.button>
                </li>
              ))}
            </ul>
          </motion.div>

          <motion.div
            className="footer-section"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.2 }}
            viewport={{ once: true, margin: "-50px" }}
          >
            <h4>Contact Us</h4>
            <motion.div
              initial={{ opacity: 0 }}
              whileInView={{ opacity: 1 }}
              transition={{ staggerChildren: 0.1 }}
              viewport={{ once: true }}
            >
              <motion.p whileHover={{ scale: 1.02 }}>üìß support@smartecodispose.com</motion.p>
              <motion.p whileHover={{ scale: 1.02 }}>üìû +91 9117204120</motion.p>
              <motion.p whileHover={{ scale: 1.02 }}>üìç Making the world greener, one disposal at a time</motion.p>
            </motion.div>
          </motion.div>
        </div>

        <motion.div
          className="footer-bottom"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ duration: 0.5, delay: 0.3 }}
          viewport={{ once: true }}
        >
          <motion.p
            whileHover={{ scale: 1.02 }}
            transition={{ duration: 0.3 }}
          >
            &copy; 2025 Smart Ecodispose. All rights reserved. Built with <motion.span 
              animate={{ scale: [1, 1.2, 1] }}
              transition={{ duration: 1, repeat: Infinity }}
              style={{ display: 'inline-block' }}
            >üíö</motion.span> for a sustainable future.
          </motion.p>
        </motion.div>
      </div>
    </footer>
  );
};

export default Footer;
